import React, { useEffect } from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";

import Inicio from "./pages/Inicio";
import Preferential from "./pages/Preferential";
import Select from "./pages/Select";
import Sabores from "./pages/Sabores";
import PizzaTradicionais from "./pages/PizzaTradicionais/";
import PizzaEspeciais from "./pages/PizzaEspeciais/";
import PizzaDoces from "./pages/PizzaDoces/";
import Tipo from "./pages/Tipo";
import PizzaSingle from "./pages/PizzaSingle";
import Check from "./pages/Check";
import Success from "./pages/Success";
import Confirmation from "./pages/Confirmation";

import OrderListContextProvider from "./Context/OrderListContext";
// Modals

import { ModelContextProvider } from "./Context/ModelContext";
import ModalManager from "./components/Modals/ModalManager";

export default function Routes(props) {
  return (
    <BrowserRouter>
      <Switch>
        <ModelContextProvider>
          <OrderListContextProvider>
            <ModalManager />
            <Route path="/" exact component={Inicio} />
            <Route path="/Preferential" component={Preferential} />
            <Route path="/Tipo" component={Tipo} />
            <Route path="/Sabores" component={Sabores} />
            <Route path="/PizzaTradicionais" component={PizzaTradicionais} />
            <Route path="/PizzaEspeciais" component={PizzaEspeciais} />
            <Route path="/PizzaDoces" component={PizzaDoces} />
            <Route path="/Select" component={Select} />
            <Route path="/PizzaSingle" component={PizzaSingle} />
            <Route path="/Check" component={Check} />
            <Route path="/Confirmation" component={Confirmation} />
            <Route path="/Success" component={Success} />
          </OrderListContextProvider>
        </ModelContextProvider>
      </Switch>
    </BrowserRouter>
  );
}
